import time
def robotSim( commands: [int], obstacles: [[int]]) -> int:
    direct = 0  # 0：向北 -1：向西  1:向东  2：向南
    move_by = 0
    current_pos = [0,0]
    next_pos = [0,0]
    max_dis = 0
    for i in commands:
        if i < 0:  # 调整方向
            if direct == 0:  # 原方向向北
                if i == -1:  # 右转
                    direct = 1  # 方向向东
                else:  # 左转
                    direct = -1  # 方向向西
            elif direct == 1:
                if i == -1:
                    direct = 2
                else:
                    direct = 0
            elif direct == -1:
                if i == -1:
                    direct = 0
                else:
                    direct = 2
            else:
                if i == -1:
                    direct = -1
                else:
                    direct = 1
        else:
            min_move_by = i  # 最小移动距离
            if direct == -1:  # 根据方向假定移动到指定位置
                next_pos = [current_pos[0]-i,current_pos[1]]  # 移动路径最大终止点
                for obs in obstacles:  # 判断该路径上是否有障碍物
                    if obs[1] == next_pos[1]:  # 障碍物在移动方向上
                        if next_pos[0] <= obs[0] < current_pos[0]:
                            if current_pos[0] - obs[0] -1 < min_move_by:
                                min_move_by = current_pos[0] - obs[0] -1
                                if min_move_by == 0:
                                    break
                current_pos[0] = current_pos[0] - min_move_by
                current_dis = current_pos[0] ** 2 + current_pos[1]**2
            elif direct == 0:
                next_pos = [current_pos[0],current_pos[1] + i]
                for obs in obstacles:  # 判断该路径上是否有障碍物
                    if obs[0] == next_pos[0]:  # 障碍物在移动方向上
                        if current_pos[1] < obs[1] <= next_pos[1]:
                            if obs[1] - current_pos[1] -1 < min_move_by:
                                min_move_by = obs[1] - current_pos[1] -1
                                if min_move_by == 0:
                                    break
                current_pos[1] = current_pos[1] + min_move_by
                current_dis = current_pos[0] ** 2 + current_pos[1]**2
            elif direct == 1:
                next_pos = [current_pos[0] + i,current_pos[1]]
                for obs in obstacles:  # 判断该路径上是否有障碍物
                    if obs[1] == next_pos[1]:  # 障碍物在移动方向上
                        if current_pos[0] < obs[0] <= next_pos[0]:
                            if obs[0] - current_pos[0] -1 < min_move_by:
                                min_move_by = obs[0] - current_pos[0] - 1
                                if min_move_by == 0:
                                    break
                current_pos[0] = current_pos[0] + min_move_by
                current_dis = current_pos[0] ** 2 + current_pos[1]**2
            else:
                next_pos = [current_pos[0],current_pos[1] - i]
                for obs in obstacles:  # 判断该路径上是否有障碍物
                    if obs[0] == next_pos[0]:  # 障碍物在移动方向上
                        if next_pos[1] <= obs[1] < current_pos[1]:
                            if current_pos[1] - obs[1] -1 < min_move_by:
                                min_move_by = current_pos[1] - obs[1] -1
                                if min_move_by == 0:
                                    break
                current_pos[1] = current_pos[1] - min_move_by
                current_dis = current_pos[0] ** 2 + current_pos[1]**2
            if current_dis > max_dis:
                max_dis = current_dis
    return max_dis

